diff --git a/clang/lib/Basic/OpenMPKinds.cpp b/clang/lib/Basic/OpenMPKinds.cpp
index a451fc7c0184..21f14a36a140 100644
--- a/clang/lib/Basic/OpenMPKinds.cpp
+++ b/clang/lib/Basic/OpenMPKinds.cpp
@@ -850,13 +850,14 @@ void clang::getOpenMPCaptureRegions(
     case OMPD_master:
       return false;
     default:
-      llvm::errs() << getOpenMPDirectiveName(LKind, llvm::omp::FallbackVersion)
-                   << '\n';
-      llvm_unreachable("Unexpected directive");
+      // Handle unexpected/unsupported directive by pushing OMPD_unknown region.
+      CaptureRegions.push_back(OMPD_unknown);
+      return false;
     }
     return false;
   };

+
   bool MayNeedUnknownRegion = false;
   for (OpenMPDirectiveKind L : getLeafConstructsOrSelf(DKind))
     MayNeedUnknownRegion |= GetRegionsForLeaf(L);
diff --git a/clang/lib/Sema/SemaOpenMP.cpp b/clang/lib/Sema/SemaOpenMP.cpp
index f16f841d62ed..2e7cd7e597e5 100644
--- a/clang/lib/Sema/SemaOpenMP.cpp
+++ b/clang/lib/Sema/SemaOpenMP.cpp
@@ -6521,8 +6521,11 @@ StmtResult SemaOpenMP::ActOnOpenMPExecutableDirective(
   case OMPD_end_declare_variant:
     llvm_unreachable("OpenMP Directive is not allowed");
   case OMPD_unknown:
-  default:
-    llvm_unreachable("Unknown OpenMP directive");
+      Diag(StartLoc, diag::err_omp_unknown_directive);
+      return StmtError();
+    default:
+      Diag(StartLoc, diag::err_omp_unknown_directive);
+      return StmtError();
   }

   ErrorFound = Res.isInvalid() || ErrorFound;
